import React, { PureComponent } from 'react';
import logo from '../img/spnd.png';

export default class CelebrateSaving extends PureComponent {
    render() {
        return (
            <header className="App-header">
                <img src={logo} className="spnd-logo" alt="spnd logo" />
                <p>Track your spending and saving.</p>
            </header>)
        }
}
